import React from "react";
import ICONS from "./icons";

const Steps = () => {
  const i = STEPS.identity;
  return (
    <div>
      {i.map((step) => (
        <div key={i.indexOf(step)}>{step}</div>
      ))}
    </div>
  );
};

export default Steps;
